    "blogTitle": "Stock/Coin Market Recorder(Airflow-Lambda-Kafka-PySpark-Rds)\n",
    "blogAuthor": "user1",
    "createdAt": ISODate("2023-10-04T10:22:25.617Z"),
    "blogContent": [
      {
        "type": "text",
        "content": "In this project I created a data pipeline using AWS technologies Lambda, EC2, RDS with Kafka, Spark and Airflow.  \nspark_cluster, lambda_function and kafka folders are for representation for cloud parts, only Airflow works on local machine."
      },
      {
        "type": "image",
        "content": "data:image/png;base64,,alt=Pipeline"
      },
      {
        "type": "text",
        "content": "- Web scraping with Lambda functions is data source for pipeline. 2 Lambda functions are invoked by Airflow every 5 minutes. Lambda functions get data from websites(coinmarketcap, yahoofinance) and send it to Kafka topics\n- Spark streaming listens Kafka topic and writes into RDS database. I create Spark cluster to do this because I just want to experience cluster mode and its configurations."
      },
      {
        "type": "image",
        "content": "data:image/png;base64,,alt=Spark Master Web UI(Spark Cluster)"
      },
      {
        "type": "text",
        "content": "## Airflow\nWe can invokes lambda function with schedule and start our cloud components with Airflow. It can be run by docker-compose up command. The **airflow_variables.json** should be uploaded Airflow variables to define necessary variables.\n```bash\n├── docker-compose.yaml\n├── airflow_variables.json\n├── dags\n│   ├── coin_dag.py\n│   ├── make_servers_ready.py\n│   └── stock_dag.py\n├── instance_pem_files\n│   ├── kafka-key.pem\n│   ├── spark-master-key.pem\n│   ├── spark-slave-1.pem\n│   ├── spark-slave-2.pem\n│   └── spark-slave-3.pem\n└── market_record\n    ├── bash_scripts.py\n    └── spark_submit\n        ├── app.py\n        └── postgresql-42.5.1.jar\n```"
      },
      {
        "type": "text",
        "content": "### There are 3 dags in airflow:\n1) **coin_market_record**:   \n This dag runs every 5 minutes and invoke Lambda function to scrape given coin market website for given coin list and push data to Kafka\n2) **stock_market_record**:   \n This dag runs every 5 minutes between 2pm and 9pm Monday through Friday(NASDAQ work time for utc) and invoke Lambda function to scrape given stock market website for given stock list and push datas to Kafka\n3) **make_servers_ready**:   \n This dag basically runs sql command or bash scripts(market_record/bash_scripts.py) with ssh/postgres connection and make sure every component (RDS db, Kafka server and Spark cluster) ready before starting pipeline. For the ssh connection, pem files located under the instance_pem_files folder are used.  \n Makes servers ready steps:\n    - **RDS**: Ensures coin market and stock market tables are exists on RDS db with CREATE TABLE IF NOT EXISTS sql command.\n    - **Kafka**: Runs start_kafka bash script to make Kafka server is ready on ec2 instance. Bash scripts downloads docker-compose file from s3 and run it on ec2 inctance. Docker-compose file makes kafka server is working and 2 topics are created for coin and stock market data.\n    - **Spark Master**: runs start_spark_master bash script to make Spark Master node ready on ec2 instance. Bash script pull docker image from dockerhub and run it on ec2 instance. Docker file starts Spark Master node. Now we can connect worker nodes to master node.\n    - **Spark Workers**: runs start_spark_workers bash scripts to make Spark Worker nodes are ready on 3 ec2 instances. Bash script pull docker image from dockerhub and run it on ec2 instance. Docker file starts Spark Worker node and connects to Spark Master.\n    - **Spark Submit**: first push spark app.py and postgres jdbc driver then run spark_submit bash command on worker node1. It starts spark app on all spark cluster."
      },
      {
        "type": "image",
        "content": "data:image/png;base64,,alt=Make Servers Ready Dag"
      },
      {
        "type": "image",
        "content": "data:image/png;base64,,alt=Airflow Connections"
      }
    ],
